import React, { useState } from "react";

const RegisterPage = () => {
  const [name, setName] = useState("");

  return (
    <div
      style={{
        marginTop: 100,
        maxWidth: 350,
        marginLeft: "auto",
        marginRight: "auto",
      }}
    >
      <h3>Register</h3>
      <form>
        <div>
          <label>Name</label>
          <input
            style={{ width: "100%" }}
            value={name}
            onChange={(e) => setName(e.target.value)}
          />
        </div>
      </form>
    </div>
  );
};

export default RegisterPage;
